"use strict";$("#status-button").click(function(){var s=$(this).data("user").split(",");s[1];$("#status-dialog").dialog({modal:!0,buttons:{Save:function(){var t=$("#status-select").val();t!==s[1]&&$.ajax({url:"/changeUserStatus",type:"POST",data:{userId:s[0],status:t},success:function(t){console.log("Статус успешно изменен")},error:function(t){console.error("Ошибка при изменении статуса: ",t)}}),$(this).dialog("close")},Cancel:function(){$(this).dialog("close")}}})});